tables.table_schema:
CREATE TABLE provider_networks (
    network_id INT PRIMARY KEY,
    network_name VARCHAR(255),
    location VARCHAR(255),
    expansion_status BOOLEAN
);

CREATE TABLE provider_networks ( 
    provider_id INT PRIMARY KEY, 
    provider_name VARCHAR(255) NOT NULL, 
    provider_location VARCHAR(255) NOT NULL 
);

CREATE TABLE provider_network (
    provider_id INT PRIMARY KEY,
    provider_name VARCHAR(255),
    network_type VARCHAR(50),
    network_size INT
);

CREATE TABLE network_region (
    region_id INT PRIMARY KEY,
    region_name VARCHAR(100),
    region_description TEXT
);

CREATE TABLE network_contract_mapping (
    contract_id INT,
    region_id INT,
    PRIMARY KEY (contract_id, region_id)
);

CREATE TABLE provider (
  provider_id INT PRIMARY KEY,
  name VARCHAR(50),
  location VARCHAR(50),
  network_size INT
);

CREATE TABLE network (
  network_id INT PRIMARY KEY,
  network_name VARCHAR(50),
  region VARCHAR(50)
);

CREATE TABLE network_provider (
  network_id INT,
  provider_id INT,
  status VARCHAR(20),
  PRIMARY KEY (network_id, provider_id)
);

CREATE TABLE negotiation (
  negotiation_id INT PRIMARY KEY,
  contract_id INT,
  network_id INT,
  negotiation_date DATE
);
